<!doctype html><html><head><meta charset="utf-8"><title>ui-page-find-title</title></head><body><script src="/spa-mabynogy.js"></script><pre>gn ui_page_find_title
 var n 1
 let pages run ui_page_find
 
 while true
  var found true
  
  forof pages  
   var title concat "Page " n
   
   if same v.title title
    assign n inc n    
    assign found false
    
    brk
   end
  end
  
  if found
   ret concat "Page " n
 end
end</pre></body></html>
